import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import dataService from '../services/dataService';

const AllBookings = () => {
  const navigate = useNavigate();
  const [bookings, setBookings] = useState([]);
  const [filteredBookings, setFilteredBookings] = useState([]);
  const [activeFilter, setActiveFilter] = useState('All');
  const [loading, setLoading] = useState(true);
  const [selectedBooking, setSelectedBooking] = useState(null);
  const [showModal, setShowModal] = useState(false);

  // Mock bookings data matching your screenshot
  const mockBookings = [
    {
      id: 3,
      user: 'dj@123',
      email: 'dj@gmail.com',
      car: 'Ferrari',
      model: 'Roma',
      pickupDate: 'Apr 22, 2025',
      returnDate: 'Apr 24, 2025',
      totalPrice: '₹200,000.00',
      status: 'Pending'
    },
    {
      id: 2,
      user: 'tej@123',
      email: 'tej@gmail.com',
      car: 'Mercedes-Benz',
      model: 'S-Class',
      pickupDate: 'Apr 22, 2025',
      returnDate: 'Apr 24, 2025',
      totalPrice: '₹140,000.00',
      status: 'Pending'
    },
    {
      id: 1,
      user: 'Wsx@123',
      email: 'wsx@gmail.com',
      car: 'Toyota',
      model: 'Fortuner',
      pickupDate: 'May 01, 2023',
      returnDate: 'May 03, 2023',
      totalPrice: '₹400.00',
      status: 'Cancelled'
    }
  ];

  useEffect(() => {
    // Simulate API call
    setTimeout(() => {
      setBookings(mockBookings);
      setFilteredBookings(mockBookings);
      setLoading(false);
    }, 500);
  }, []);

  // Filter bookings based on status
  const handleFilterChange = (filter) => {
    setActiveFilter(filter);
    if (filter === 'All') {
      setFilteredBookings(bookings);
    } else {
      setFilteredBookings(bookings.filter(booking => booking.status === filter));
    }
  };

  if (loading) {
    return (
      <div className="d-flex" style={{ minHeight: '100vh' }}>
        {/* Sidebar */}
        <aside style={{ width: 200, background: '#2c3e50', color: '#fff', minHeight: '100vh' }} className="p-3">
          <h4 className="text-white mb-4">Admin Panel</h4>
          <ul className="nav flex-column">
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin')}>
                <i className="fas fa-tachometer-alt me-2"></i> Dashboard
              </button>
            </li>
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/cars')}>
                <i className="fas fa-motorcycle me-2"></i> Vehicles
              </button>
            </li>
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/users')}>
                <i className="fas fa-users me-2"></i> Users
              </button>
            </li>
            <li className="nav-item mb-2">
              <button className="btn btn-link text-white text-start w-100 p-2 active" onClick={() => navigate('/admin/bookings')}>
                <i className="fas fa-calendar-alt me-2"></i> Bookings
              </button>
            </li>
          </ul>
        </aside>

        {/* Main Content */}
        <main className="flex-grow-1" style={{ background: '#ecf0f1' }}>
          <div className="text-center p-5">
            <div className="spinner-border text-primary" role="status">
              <span className="visually-hidden">Loading...</span>
            </div>
            <p className="mt-3">Loading bookings...</p>
          </div>
        </main>
      </div>
    );
  }

  return (
    <div className="d-flex" style={{ minHeight: '100vh' }}>
      {/* Sidebar */}
      <aside style={{ width: 200, background: '#2c3e50', color: '#fff', minHeight: '100vh' }} className="p-3">
        <h4 className="text-white mb-4">Admin Panel</h4>
        <ul className="nav flex-column">
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin')}>
              <i className="fas fa-tachometer-alt me-2"></i> Dashboard
            </button>
          </li>
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/cars')}>
              <i className="fas fa-motorcycle me-2"></i> Vehicles
            </button>
          </li>
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/users')}>
              <i className="fas fa-users me-2"></i> Users
            </button>
          </li>
          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2 active" onClick={() => navigate('/admin/bookings')}>
              <i className="fas fa-calendar-alt me-2"></i> Bookings
            </button>
          </li>
        </ul>
      </aside>

      {/* Main Content */}
      <main className="flex-grow-1" style={{ background: '#ecf0f1' }}>
        <div className="d-flex justify-content-between align-items-center p-4 bg-white border-bottom">
          <h2 className="mb-0">Manage Bookings</h2>
          <button className="btn btn-outline-danger btn-sm" onClick={() => { localStorage.removeItem('token'); navigate('/admin/login'); }}>
            <i className="fas fa-sign-out-alt me-1"></i> Logout
          </button>
        </div>

        <div className="p-4">
          {/* Filter Buttons */}
          <div className="mb-4">
            <button 
              className={`btn me-2 ${activeFilter === 'All' ? 'btn-primary' : 'btn-outline-primary'}`}
              onClick={() => handleFilterChange('All')}
            >
              All
            </button>
            <button 
              className={`btn me-2 ${activeFilter === 'Pending' ? 'btn-warning' : 'btn-outline-warning'}`}
              onClick={() => handleFilterChange('Pending')}
            >
              Pending
            </button>
            <button 
              className={`btn me-2 ${activeFilter === 'Confirmed' ? 'btn-success' : 'btn-outline-success'}`}
              onClick={() => handleFilterChange('Confirmed')}
            >
              Confirmed
            </button>
            <button 
              className={`btn me-2 ${activeFilter === 'Cancelled' ? 'btn-danger' : 'btn-outline-danger'}`}
              onClick={() => handleFilterChange('Cancelled')}
            >
              Cancelled
            </button>
          </div>

          <div className="bg-white rounded shadow-sm">
            <div className="table-responsive">
              <table className="table table-striped mb-0">
                <thead style={{ background: '#f8f9fa' }}>
                  <tr>
                    <th className="px-4 py-3">ID</th>
                    <th className="px-4 py-3">User</th>
                    <th className="px-4 py-3">Car</th>
                    <th className="px-4 py-3">Pickup Date</th>
                    <th className="px-4 py-3">Return Date</th>
                    <th className="px-4 py-3">Total Price</th>
                    <th className="px-4 py-3">Status</th>
                    <th className="px-4 py-3">Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {filteredBookings.map((booking) => (
                    <tr key={booking.id}>
                      <td className="px-4 py-3">{booking.id}</td>
                      <td className="px-4 py-3">
                        <div>
                          <div>{booking.user}</div>
                          <small className="text-muted">{booking.email}</small>
                        </div>
                      </td>
                      <td className="px-4 py-3">
                        <div>
                          <div>{booking.car}</div>
                          <small className="text-muted">{booking.model}</small>
                        </div>
                      </td>
                      <td className="px-4 py-3">{booking.pickupDate}</td>
                      <td className="px-4 py-3">{booking.returnDate}</td>
                      <td className="px-4 py-3">{booking.totalPrice}</td>
                      <td className="px-4 py-3">
                        <select 
                          className={`form-select form-select-sm ${
                            booking.status === 'Pending' ? 'text-warning' : 
                            booking.status === 'Confirmed' ? 'text-success' : 
                            'text-danger'
                          }`}
                          value={booking.status}
                          onChange={(e) => {
                            // Handle status change
                            const updatedBookings = bookings.map(b => 
                              b.id === booking.id ? { ...b, status: e.target.value } : b
                            );
                            setBookings(updatedBookings);
                            if (activeFilter === 'All') {
                              setFilteredBookings(updatedBookings);
                            } else {
                              setFilteredBookings(updatedBookings.filter(b => b.status === activeFilter));
                            }
                          }}
                        >
                          <option value="Pending">Pending</option>
                          <option value="Confirmed">Confirmed</option>
                          <option value="Cancelled">Cancelled</option>
                        </select>
                      </td>
                      <td className="px-4 py-3">
                        <button
                          className="btn btn-info btn-sm me-2"
                          onClick={() => {
                            setSelectedBooking(booking);
                            setShowModal(true);
                          }}
                        >
                          <i className="fas fa-eye me-1"></i> View
                        </button>
                        <button className="btn btn-primary btn-sm">
                          <i className="fas fa-edit me-1"></i> Edit
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </main>

      {/* Booking Details Modal */}
      {showModal && selectedBooking && (
        <div className="modal fade show" style={{ display: 'block', backgroundColor: 'rgba(0,0,0,0.5)' }}>
          <div className="modal-dialog modal-lg">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">Booking Details - ID: {selectedBooking.id}</h5>
                <button
                  type="button"
                  className="btn-close"
                  onClick={() => {
                    setShowModal(false);
                    setSelectedBooking(null);
                  }}
                ></button>
              </div>
              <div className="modal-body">
                <div className="row">
                  <div className="col-md-6">
                    <h6 className="fw-bold mb-3">Customer Information</h6>
                    <p><strong>Username:</strong> {selectedBooking.user}</p>
                    <p><strong>Email:</strong> {selectedBooking.email}</p>
                  </div>
                  <div className="col-md-6">
                    <h6 className="fw-bold mb-3">Vehicle Information</h6>
                    <p><strong>Vehicle:</strong> {selectedBooking.car}</p>
                    <p><strong>Model:</strong> {selectedBooking.model}</p>
                  </div>
                </div>
                <hr />
                <div className="row">
                  <div className="col-md-6">
                    <h6 className="fw-bold mb-3">Booking Details</h6>
                    <p><strong>Pickup Date:</strong> {selectedBooking.pickupDate}</p>
                    <p><strong>Return Date:</strong> {selectedBooking.returnDate}</p>
                    <p><strong>Total Price:</strong> <span className="text-success fw-bold">{selectedBooking.totalPrice}</span></p>
                  </div>
                  <div className="col-md-6">
                    <h6 className="fw-bold mb-3">Status</h6>
                    <span className={`badge fs-6 ${
                      selectedBooking.status === 'Pending' ? 'bg-warning text-dark' :
                      selectedBooking.status === 'Confirmed' ? 'bg-success' :
                      'bg-danger'
                    }`}>
                      {selectedBooking.status}
                    </span>
                  </div>
                </div>
              </div>
              <div className="modal-footer">
                <button
                  type="button"
                  className="btn btn-secondary"
                  onClick={() => {
                    setShowModal(false);
                    setSelectedBooking(null);
                  }}
                >
                  Close
                </button>
                <div className="btn-group">
                  <button
                    className="btn btn-warning"
                    onClick={() => {
                      // Update booking status to Pending
                      const updatedBookings = bookings.map(b =>
                        b.id === selectedBooking.id ? { ...b, status: 'Pending' } : b
                      );
                      setBookings(updatedBookings);
                      if (activeFilter === 'All') {
                        setFilteredBookings(updatedBookings);
                      } else {
                        setFilteredBookings(updatedBookings.filter(b => b.status === activeFilter));
                      }
                      setShowModal(false);
                      setSelectedBooking(null);
                    }}
                  >
                    Mark Pending
                  </button>
                  <button
                    className="btn btn-success"
                    onClick={() => {
                      // Update booking status to Confirmed
                      const updatedBookings = bookings.map(b =>
                        b.id === selectedBooking.id ? { ...b, status: 'Confirmed' } : b
                      );
                      setBookings(updatedBookings);
                      if (activeFilter === 'All') {
                        setFilteredBookings(updatedBookings);
                      } else {
                        setFilteredBookings(updatedBookings.filter(b => b.status === activeFilter));
                      }
                      setShowModal(false);
                      setSelectedBooking(null);
                    }}
                  >
                    Confirm
                  </button>
                  <button
                    className="btn btn-danger"
                    onClick={() => {
                      // Update booking status to Cancelled
                      const updatedBookings = bookings.map(b =>
                        b.id === selectedBooking.id ? { ...b, status: 'Cancelled' } : b
                      );
                      setBookings(updatedBookings);
                      if (activeFilter === 'All') {
                        setFilteredBookings(updatedBookings);
                      } else {
                        setFilteredBookings(updatedBookings.filter(b => b.status === activeFilter));
                      }
                      setShowModal(false);
                      setSelectedBooking(null);
                    }}
                  >
                    Cancel Booking
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AllBookings;
